import React from 'react';
import './App.css';
import './bootstrap.css';
import ArticleList from './ArticleList';


const articles = [
  {
    id: 1,
    title: 'Sample Article 1',
    summary: 'This is a summary of the first article.',
    link: 'https://example.com/article1',
    published: '2023-08-19T10:00:00',
  },
  // Add more articles here
];

function Header() {
  return (
    <header>
      <nav className="navbar navbar-expand-sm navbar-toggleable-sm navbar-light bg-white border-bottom box-shadow mb-3">
        <div className="container-fluid">
          <a className="navbar-brand" href="/">JensensWebApp</a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target=".navbar-collapse"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="navbar-collapse collapse d-sm-inline-flex justify-content-between">
            <ul className="navbar-nav flex-grow-1">
              <li className="nav-item">
                <a className="nav-link text-dark" href="/">Home</a>
              </li>
              <li className="nav-item">
                <a className="nav-link text-dark" href="/privacy">Privacy</a>
              </li>
            </ul>
          </div>
          <div>
            <button className="fixed-button" id="changeBackground">Toggle dark mode</button>
          </div>
        </div>
      </nav>
    </header>
  );
}

function Footer() {
  return (
    <footer className="border-top footer text-muted">
      <div className="container">
        &copy; 2023 - JensensWebApp - <a href="/privacy">Privacy</a>
      </div>
    </footer>
  );
}

function App() {
  return (
    <div>
      <Header />
      <div className="container">
        <main role="main" className="pb-3">
          {/* RenderBody content will go here */}
        </main>
      </div>
      <Footer />
    </div>
  );
}

export default App;
